import React from 'react';
import '../components/css/Projects.css';

const Pawmeet: React.FC = () => {
  return (
    <div className="min-h-screen bg-[#f3f2ea] p-8">
      <div className="max-w-6xl mx-auto">
        <h1 className="text-4xl font-serif mb-8">PAWMEET Application</h1>
        <div className="bg-white p-8 rounded-lg shadow-lg">
          <img 
            src={`${process.env.PUBLIC_URL}/pawmeet.png`} 
            alt="PAWMEET Application"
            className="w-full max-w-2xl mx-auto mb-8"
          />
          <div className="prose max-w-none">
            <h2 className="text-2xl font-serif mb-4">Project Overview</h2>
            <p className="mb-4">PAWMEET is a social platform designed for pet owners to connect and organize meetups for their pets.</p>
            
            <h2 className="text-2xl font-serif mb-4">Key Features</h2>
            <ul className="list-disc pl-6 mb-4">
              <li>User-friendly interface for pet owners</li>
              <li>Location-based meetup organization</li>
              <li>Pet profile management</li>
              <li>Social networking features</li>
            </ul>
            
            <h2 className="text-2xl font-serif mb-4">Technologies Used</h2>
            <p>React, TypeScript, Tailwind CSS, Firebase</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Pawmeet;
